B.a1K=new A.bS("views",null,null,null,null,null,null)
B.a1L=new A.bS("The settings menu is the best example of a good user experience in every application. In clockworld, it enables the customization of the skin in various ways, split into categories. it manages to display a big amount of information organized in a very convenient way. Just like that, clockworld settings menu features consistency along with sleek and user friendly environment despite rainmeter\u2019s restrictions. By using packages created by the community and with the advice of its people, this interface came to life and it\u2019s praised as one of he best Rainmeter settings menus out there.",null,null,B.J,null,null,null)
