B.a1R=new A.bS("Genres presentation for the VH1 music channel. The process follows the previous principle where all the genres are presented on their own with a corresponding music video and at the end, all the genres graphics together presenting the channel's content identity as a whole.",null,B.dD,null,null,null,null)
B.Zo=new A.v(!0,null,null,null,null,null,40,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.a1T=new A.bS("Moving away from the classics",null,B.Zo,null,null,null,null)
B.a1U=new A.bS('Influenced by many other successful motion graphic designs for TV channels, I took advantage of the characteristic shape inside "ERT"\'s "R" letter and used it as the primary form. Its appealing effect is caused by smooth opacity and position transitions which describe the overall character and design principles of the channel. The "Inside R" shape is playing a key part and is moving around with the basic information elements as a guide both for the eye and the ierarchy.',null,B.dD,null,null,null,null)
B.a1V=new A.bS("ClockWorld\u2019s layout is based on familiarity and ease of access. It is made sure that users can find and access information without doubt and misunderstandings. Thus, the screen is split into 4 parts and in each one there is the piece of information that suits best comfortably-wise. First, on top there is the artistic part of he skin which serves as a mental boost providing a happy message to the user. Secondly, starting from the left the music information ensures that readability rules are kept in check as most countries in the world read from left to right. After that, on the right there is the clock which is placed according to the windows original clock, with the goal of embracing familiarity. Last, the shortcuts on the bottom.",null,null,B.J,null,null,null)
B.a1W=new A.bS("Initial approach",null,B.lb,null,null,null,null)
B.a1X=new A.bS("Integrating the weather widget was one of the biggest coding challenges for this skin, and still remains one. Constant API overloads, wrong web scrapping, server shutdowns and other issues have shaped the lifecycle of this widget. Despite that, design-wise it represents the most basic information anyone could use at any time of the day with the current temperature being the most prominent element. ",null,null,B.J,null,null,null)
B.a1Y=new A.bS("Remvi's unique brunch establishment demanded a sophisticated approach to its social media identity. Primarily hosting weekly events and special holiday dinners, Remvi adopts a refined and premium style. The color palette is inspired by the interior decor, emphasizing gold and olive green hues. The design prominently features minimal script typography, ensuring clarity while allowing essential details to stand out. This cohesive aesthetic conveys an overall impression of sleek, high-end service, underscoring the delicacy and elegance that Remvi offers.",null,null,null,null,null,null)
B.a1Z=new A.bS("To create automatic updates, first it is needed to store the new files to an online database where they can be downloaded at any time GitHub is an excellent tool that not only stores the new files but also keeps track of version history and can offer the open source flag for any project. Then, after creating a GitHub repository, I made a script using basic PowerShell language which simply fetches (downloads) the repository as a .zip. After that, it unzips the file and replaces the old files with the new ones in the Rainmeter\u2019s skin folder.\n\nThis method is accompanied by an update checker in the settings which checks the current skin\u2019s version by reading a string in a local file and comparing it to another online file which contains the newest version as a string. If those versions match, the skin is up to date but if the local version is smaller than the online one, there is an update available. When pressing the \u201cCheck for updates\u201d button, the algorithm retrieves both strings, removes dots, coverts them to intEgers and makes the comparison with a simple substraction.\n\nThis simple approach was part of a detailed research on Rainmeter\u2019s capabilities and other languages, such as lua which is part of Rainmeter\u2019s development.",null,null,B.J,null,null,null)
B.a2_=new A.bS("Each genre is represented by a different shape and a color, making it recognisable among the others and providing a sense of change while the element alignment stays the same. Interesting text and shape animations, represent the genre's style and keep the viewer's attention.",null,B.dD,null,null,null,null)
B.a20=new A.bS("Don't worry, you can just return to Home",null,null,null,null,null,null)
B.a23=new A.bS("The basic color palette of ClockWorld comes from the selected wallpapers, each one representing the color of the sunlight at that time of the day. As a highly customizable skin, the colors shouldn\u2019t be tied to one or two specifics but work as  base for user changes. Via the settings menu, the user can select any color or each of the 5 timestamps of the day and create their own version of he skin.",null,null,B.J,null,null,null)
B.a24=new A.bS("The goal of this feature for the future is to create fully automatic updates that happen automatically when users open their computer. This will make the use experience even more fluent removing the user\u2019s need to check for updates completely. Due to some limitations of rainmeter, progress is slow while I am doing a deeper research about multiple other ways to integrate this feature. Right now, all I can say is \u201ccoming soon\u201d!\n\nAnother possible idea is to create a skin distribution platform (like google play store) where developers can upload their skins and be eligible for OTA updates. There as been a test in the past creatin a platform like tis, but didn't go forward to due to its huge workload and platform limitations tat currently, I don't have the appropriate knowledge to work around.",null,null,B.J,null,null,null)
B.a25=new A.bS("The shortcuts were designed by me specifically for this skin. As I could not find an existing icon pack matching the design or including all the necessary icons, I decided to create my own. They are based on the fluent design system of Windows 10 and have a gradient-style approach, creating depth and adding to the skins character.\n\nIn the past, there have been attempts to please them as a separate icon pack but the work demand was very high and the each icon\u2019s adaptability to the new design was not guaranteed. The project as available for some time but was eventually taken down.",null,null,B.J,null,null,null)
