B.a27=new A.bS("The font selection was one of the most crucial decision for he skin\u2019s appearance. The type of each font can shape the skin\u2019s character and it is the first asset that users see when selecting a skin to decorate their desktop. Summer loving is one of my favorite handwritten fonts as it has many alternative glyphs for most letters and its texture creates a summer vibe that really suits the skin\u2019s character. Google sans works as the main font. In comparison to summer loving it is rounder, creating a much needed contrast to its pointier edges. Google sans also offers great readability and it\u2019s both great for large text and small paragraphs, useful in the music player and the settings menu.",null,null,B.J,null,null,null)
